const testFileTree = {
  name: 'root',
  isFolder: true,
  assets: {
    name: 'assets',
    isFolder: true,
    fonts: { name: "fonts", isFolder: true, helvetica: { name: "helvetica"} },
    images: { isFolder: true, "logo.png": {}, "avatar.jpg": {} },
  },
  "index.js": {},
};

export default testFileTree;
